import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="ctnr">
        <div className="header">Login</div>
        <div className="page">
          <label htmlFor="email">Email </label>

          <input type="email" name="email" id="email" />
          <label htmlFor="password">Password </label>

          <input type="password" name="password" id="password" />
        </div>
      </div>
    </div>
  );
}

export default App;
